@Override
protected void processServiceAction(GDataAccount account) throws ServiceException {
    try{
    this.service.updateAccount(account);
    }catch (ServiceException e) {
        LOG.error("Can't update account -- "+e.getMessage(),e);
        throw e;
    }

}

